const Food = ({food}) => {

    var nameString = ' ' + food.name
    console.log(nameString.length)
    var dotss = ' '
        for(var i = 0 ; i < 120 - nameString.length ; i ++){
            dotss.append('   .   ')
        }
    
    return(
        <div className = "food">
            <h3>
                {food.name}
                {dotss}
                {food.price}
            </h3>
            <h3>
                {food.description}
            </h3>
        </div>
    )
}

export default Food
